import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Usuarios from './pages/usuarios/usuarios';

import "./App.css";

function App() {
  return (
    <Router>
      <div className="app">

        <div className="content">
          <Routes>
            <Route path="/usuarios" element={<Usuarios />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
